import React, { Children } from 'react'
const onClick =(ev,id)=>{
    alert("On click" + id)
}
const GameCircle = ({id,color,children}) => {

  return (
    <div style={{backgroundColor:color,width:100,height:100,margin:10,borderRadius:'50%',width:'500px'}} onClick={(ev)=>onClick(ev,id)}>
      {children}
    </div>
  )
}

export default GameCircle
